  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path='/checkout'>
            <Header />
            <Checkout/>
          </Route>
          <Route path='/'>

          </Route>
        </Switch>
      </Router>


      <Header />
      <Home />
    </div>
  );
}

export default App;
